Let’s start by considering some key points:

1. A critical mechanism in responder behavior is fairness: responders are more likely to accept offers that are at or above what they “deserve” based on their token contributions, and they penalize offers that fall below this fairness benchmark. Previous models have captured fairness costs as a function of the difference between the offered share and a fairness benchmark (r), but many of these models use an absolute or quadratic difference computed in monetary units. 

2. Here we propose a normalization that compares the offered proportion (split_self/combined_earning) with the fair proportion (token_self/(token_self+token_opp)). In this view, responders experience a cost for receiving less than a fair proportion, with the cost growing nonlinearly (quadratically) with the relative shortfall. Offers equal to or above the fairness benchmark carry no cost. 

3. Mathematically, we first define:
  p = token_self / (token_self + token_opp)   [the fairness benchmark proportion]
  q = split_self / combined_earning      [the actual offered proportion]
Then, using a penalty that only applies when q < p, the utility for accepting an offer is given by:
  U = mu + split_self – lambda_param × [max(p – q, 0)]² × combined_earning

4. This formula has two learnable parameters:
  • mu is a baseline bias parameter.
  • lambda_param is the sensitivity to fairness shortfalls.
They are assigned generous finite bounds while ensuring that the fairness penalty is applied only when the offered proportion is below what is “fair.”

5. In addition to the free parameters, all other variables come from the observed data. This model uses observable monetary and token data to compute both the actual offer and the fairness benchmark, and then penalizes a shortfall proportionally to the total combined earnings.

Below is the formal specification:

<MODEL>
Let p = token_self / (token_self + token_opp)
Let q = split_self / combined_earning
U = mu + split_self - lambda_param * [max(p - q, 0)]^2 * combined_earning
</MODEL>

