A utility model for responders that rewards the monetary offer and penalizes deviations below a fairness benchmark. The fair share is defined as the participant’s token contribution proportion relative to total tokens, while the actual offer is considered as the proportion of the combined earnings. The penalty is applied quadratically to any shortfall (only when the actual offered proportion is below the fair share) and is scaled by the combined earning. Two learnable parameters—the baseline bias (mu) and fairness sensitivity (lambda_param)—govern the overall utility.
